import { Component } from '@angular/core';

@Component({
  selector: 'app-details-endereco',
  templateUrl: './details-endereco.component.html',
  styleUrls: ['./details-endereco.component.css']
})
export class DetailsEnderecoComponent {

}
<h3 class="text-center"> Detalhes do Militar </h3>



<div class="text-center">

    <div>
        <label><b> Rua: </b></label>{{ endereco.rua}}
    </div>
    <div>
        <label><b> Número:</b></label>{{ endereco.numero}}
    </div>
    <div>
        <label><b> Cidade:</b></label>{{ endereco.cidade}}
    </div>
    <div>
        <label><b> Estado:</b></label>{{ endereco.estado}}
    </div>
    <div>
        <label><b> CEP:</b></label>{{ endereco.cep}}
    </div>
    <div>
        <label><b> Complemento:</b></label>{{ endereco.complemento}}
    </div>
    <button  class="btn btn-info"> 
        <a href="enderecos-list" routerlink="/enderecos-list" routerLinkActive="active" class="nav-link">

            Lista de Endereços</a>    
    </button>

</div>
